import DiaryInput from "./components/Diary-input"
useEffect(() => {
  const loadEntries = async () => {
    try{
      getEntries()
    }
    catch(e) {
      console.log(e);
    }
    loadEntries()
  }

}, [])

function App() {
  return (
    <Layout>
      <DiaryInput/>
      <DiaryEntery/>
    </Layout>

  );
}

export default App;
